package com.omniscien.lsmetric.model;

public class ResultRespondOnlyModel {

	public ResultRespondOnlyModel() {
		// TODO Auto-generated constructor stub
	}
	

		
		public String metric = "";
		public int sourcelines = 0;
		public int targetlines = 0;
		public String getMetric() {
			return metric;
		}
		public void setMetric(String metric) {
			this.metric = metric;
		}
		public int getSourcelines() {
			return sourcelines;
		}
		public void setSourcelines(int sourcelines) {
			this.sourcelines = sourcelines;
		}
		public int getTargetlines() {
			return targetlines;
		}
		public void setTargetlines(int targetlines) {
			this.targetlines = targetlines;
		}
		
		
	

}
